		this.pMessageBroker = new MessageBrokerElements();
		this.pConnectionModule = new ConnectionModuleElements();
		this.pWiredModule = new WiredModuleElements();
		this.pWirelessModule = new WirelessModuleElements();
		this.pController = new ControllerElements();
		this.pMessagingLink = new MessagingLinkElements();
		this.pPosition = new PositionElements();
